('2367','18','7887','villa wieland',Null,'Luxusvilla mit Panorama-Meerblick Nova Santa Ponsa','33322','Im Südwesten Mallorca´s liegt in der Gemeinde Calvia / Santa Ponsa diese Luxusvilla auf einem ca 1.000m² großen Hanggrundstück mit südlicher Ausrichtung. Von allen Räumen hat man einen spektakulären Panorama-Meerblick. Die Villa wurde 2002 mit hochwertigen Materialien erstellt und bietet auf 320m² Wohnfläche Wohn-Esszimmer mit überdachter Terrasse, 4 Schlafzimmer, 3 Badezimmer, Küche und Hauswirtschaftsraum. Die Garage bietet Platz für 1 Auto. Im angelegten Garten befindet sich noch ein Pool umgeben von Liegeterrassen. Zur Ausstattung gehören u.a. Fußbodenheizung, Klima w/k, Holz –Doppelglasfenster u.v.m. Die Villa kann möbliert erworben werden','33323','3200000','106','2015-08-21 16:08:34','106','2015-08-21 16:09:27',Null,'2454','121','1152',1,'1','0',Null,Null,Null,'33324',Null,'0','0','0',Null,'2015-08-21 16:11:49',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33325',Null,'33326',Null,'33327',Null,'33328','00491717736149','33329','0',0,'4');
